import Link from 'next/link';

export default function Index() {
    return (
        <div>
            <Link href="/about">
                <a>About Page</a>
            </Link>
            <p>Hello Next.js</p>
            <Link href="/about">
                <a title="About Page">About Page</a>
            </Link>
            <Link href="/about" title="About Page">
  <a>About Page</a>
</Link>
        </div>
    );
}
